# Both female and male first names, including androgynous names
both_first_names = female_first_names|male_first_names

def handle_request(request):
    gender_options = ("any gender", "female", "male", "gender non-specific")

    if 'number' not in request.GET:
        number = 1
    else:
        number = int(request.GET["number"])
        if number > 100:
            number = 100
        elif number < 1:
            number = 1

    numbers = range(1,101)
    return_numbers = [number] + [n for n in numbers if n != number]

    if 'gender' not in request.GET:
        firsts = random.sample(both_first_names, number)
        return_options = gender_options
    else:
        return_options = [request.GET['gender']] + [g for g in gender_options if g != request.GET['gender']]
    
        if request.GET['gender'] == 'gender non-specific':
            firsts = random.sample(no_gender_first_names, number)
        elif request.GET['gender'] == 'female':
            firsts = random.sample(female_first_names, number)
        elif request.GET['gender'] == 'male':
            firsts = random.sample(male_first_names, number)
        elif request.GET['gender'] == 'any gender':
            firsts = random.sample(both_first_names, number)
        else:
            firsts = random.sample(both_first_names, number)
    
    lasts  = random.sample(surnames, number)

    names = [" ".join([first, last]) for first, last in zip(firsts, lasts)]

    return_dict = {"names": names}

    if request.path == "/american.html":
        return_dict.update({ "title": "American names",
                             "description": f"First names are from the\
                                              <a href=\"https://www.census.gov/topics/population/genealogy/data/1990_census/1990_census_namefiles.html\">1990 U.S. Census</a>.\
                                              Gender divisions reflect those from the original data. Gender\
                                              non-specific names appear in both the female and male lists\
                                              Last names are from the\
                                              <a href=\"https://www.census.gov/topics/population/genealogy/data/2010_surnames.html\">2010 U.S. Census</a>.\
                                              Both sets of data are in the public domain.\
                                              <a href=\"{ request.route_url('american_data') }\">Download a full copy of the data.</a>",
                              "options": return_options,
                              "numbers": return_numbers })

    return return_dict


@view_config(route_name="american", renderer="../templates/random_names.jinja2")
def html_view(request):
    return handle_request(request)


@view_config(route_name="american_data", renderer="json")
def data_view(request):
    return {"female_names": tuple(female_first_names),
            "male_names": tuple(male_first_names),
            "gender_non_specific_names": tuple(androgynous_first_names),
            "surnames": tuple(surnames)}


@view_config(route_name="american_text", renderer="../templates/random_names_text.jinja2")
def text_view(request):
    return handle_request(request)


@view_config(route_name="american_json", renderer="json")
def json_view(request):
    return handle_request(request)